/*******************************************************************************
 * Datum.js
 ******************************************************************************/

/* eslint-env browser */
/* globals Set Map define */
define(['/jQuery.min.js', '/socket.io-client-1.4.8.min.js'], function (
  $,
  io,
  undefined // eslint-disable-line
) {
  'use strict';
  var AQ = AQ || {};

  // Note: Add `?events=false` to a url to stop all events
  const query = new Set(location.search.slice(1).split('&'));

  // TODO: how does session persistence work for events
  const sessionId = getPersistedSessionId();
  if (sessionId) {
    // TODO: Can we use beacon or beforeunload to send detach event?
    fetch(`/_socket/detach/${sessionId}`);
  }
  // TODO: Maybe sessionIds should be stored in localStorage as an array and when
  // we try to detach them, we can get a payload back that says whether it was
  // successful or not
  sessionStorage.clear();

  function flattenIfId(obj) {
      if (obj && typeof obj === 'object') {
          console.log(obj);
          if (obj.relation_id) {
              console.log('got row');
          }
          if (obj.schema_id) {
              console.log('got relation');
          }
          if (obj.schema_id) {
              console.log('got function?');
          }
          if (obj.pk_column_id) {
              console.log('got field?');
          }
      }
      return obj;
  }

  function buildQueryString(options) {
    const keys = [];

    if (typeof options != 'undefined') {
      // Meta data defaults to true;
      if (typeof options.meta_data == 'undefined') {
        options.meta_data = true;
      }

      // Map the keys of the options object to an array of encoded url components
      const params = Object.entries(options).sort(([a], [b]) =>
        a.localeCompare(b)
      );
      for (let [key, value] of params) {
        switch (key) {
          case 'where':
            // where: { name: 'column_name', op: '=', value: 'value' }
            // where: [{ name: 'column_name', op: '=', value: 'value' }]
            if (typeof value.length == 'undefined') value = [value];

            keys.push(
              value
                .map(function (where) {
                  return 'where=' + encodeURIComponent(JSON.stringify(where));
                })
                .join('&')
            );
            break;

          case 'order_by':
            // So many possibilities...
            // order_by: '-?column_name'
            // order_by: ['-?column_name']
            // order_by: { 'column_name': 'asc|desc' }
            // order_by: [{ 'column_name': 'asc|desc' }]
            // order_by: { column: 'column_name', direction: 'asc|desc' }
            // order_by: [{ column: 'column_name', direction: 'asc|desc' }]
            if (typeof value.length == 'undefined') value = [value];

            keys.push(
              key +
                '=' +
                encodeURIComponent(
                  value
                    .map(function (o) {
                      return (
                        (typeof o.direction != 'undefined' &&
                        o.direction != 'asc'
                          ? '-'
                          : '') + o.column
                      );
                    })
                    .join(',')
                )
            );
            break;

          case 'limit':
          // limit: number
          /* eslint-disable-next-line no-fallthrough */
          case 'offset':
            // offset: number
            var parsedNum = parseInt(value);
            if (!isNaN(parsedNum)) {
              keys.push(key + '=' + parsedNum);
            }
            break;

          case 'session_id':
            keys.push(
              'session_id=' + encodeURIComponent(JSON.stringify(value))
            );
            break;

          case 'meta_data':
          case 'args':
          case 'exclude':
          case 'include':
            keys.push(key + '=' + encodeURIComponent(JSON.stringify(value)));
            break;
          default:
            console.log('query_options: could not find key', key, value);
        }
      }
    }

    // Return the query string by joining the array with &'s
    return keys.length ? '?' + keys.join('&') : '?';
  }

  function getPersistedSessionId() {
    return sessionStorage.getItem('sessionId') || null;
  }

  function persistSessionId(sessionId) {
    if (sessionId) {
      sessionStorage.setItem('sessionId', sessionId);
    }
  }

  class Socket {
    constructor(handleEvent) {
      this.handleEvent = handleEvent;
      this.isAttached = false;
      this.sessionId = null;
      this.intendedSessionId = null;
      this._socket = io('/');
      this._socket.on('event', this.onMessage.bind(this));
      this._socket.on('connect', () => {
        if (!this.isAttached) {
          if (this.sessionId) {
            this.attach(this.sessionId);
          } else if (this.intendedSessionId) {
            this.attach(this.intendedSessionId);
          }
          // else { connectSession has not been called yet }
        }
      });
      this._socket.on('disconnect', () => {
        this.isAttached = false;
        // socket.io will handle reconnecting
      });
      this.cache = {};
    }
    onMessage(event) {
      let response;
      try {
        response = JSON.parse(event);
      } catch (e) {
        console.error('socket: error while parsing event', e);
        return;
      }

      switch (response.type) {
        case 'attached':
          this.isAttached = true;
          this.sessionId = response.sessionId;
          this.intendedSessionId = null;
          console.log('socket attached', response.sessionId);
          break;

        case 'event':
          this.handleEvent(response.data);
          break;
      }
    }
    attach(sessionId) {
      if (!this.sessionId) {
        this.intendedSessionId = sessionId;
      }
      if (this._socket.connected) {
        if (!sessionId) {
          console.error('socket error: invalid session id', sessionId);
        }
        this._socket.emit('attach', sessionId);
      }
      // else { socket will attempt to attach when connected }
    }
  }

  class Endpoint {
    constructor(url, database, evented) {
      this.url = url;
      this.database = database;
      this.evented = query.has('events=false') ? false : evented;
      this.cache = {};
      this.sessionId = null; // = getPersistedSessionId();
      this.socket = this.evented
        ? new Socket(this.handleEvent.bind(this))
        : null;
    }
    connectSession(sessionId) {
      this.sessionId = sessionId;
      if (this.socket) {
        this.socket.attach(sessionId);
      }
    }
    handleEvent(event) {
      const {
        subscription_type: subscriptionType,
        payload,
        operation,
        row_id: rowId,
      } = event;
      console.log({subscriptionType, payload, operation, rowId});

      switch (subscriptionType) {
        case 'table': {
          console.log(subscriptionType + ':' + operation);
          const rowsets = this.database.getTracked(
            relationId(rowId.pk_column_id.relation_id).url()
          );
          for (const rowset of rowsets) {
            rowset._triggerEvent(operation, payload, rowId);
          }
          break;
        }
        case 'column':
          console.log(subscriptionType + ':' + operation);
          break;
        case 'row':
          console.log(subscriptionType + ':' + operation);
          break;
        case 'field':
          console.log(subscriptionType + ':' + operation);
          break;
        default:
          break;
      }
      // TODO: Delete event
    }
    _resource(method, meta_id, args, data) {
      args = args || {};

      $('.debugger3').trigger('debugger_request', {
        method: method,
        meta_id: meta_id,
        args: args,
        data: data,
      });

      // Get use_cache from args or data
      let use_cache = false;
      if (!data && args.use_cache) {
        use_cache = args.use_cache;
        delete args.use_cache;
      } else if (data?.use_cache) {
        use_cache = data.use_cache;
        delete data.use_cache;
      }

      // allow un-evented call by passing false for 'events'
      const passed = Object.hasOwn(args, 'events');
      const isTruthy = Boolean(args.events);
      if (!passed || isTruthy) {
        // If this connection is evented, get event_session_id
        if (this.evented && this.sessionId) {
          args.session_id = this.sessionId;
        }
      }
      delete args.events;

      // URLs
      const id_url = meta_id.to_url(true); // ID part of the URL only
      const url_without_query = this.url + id_url;
      const url_with_query = url_without_query + buildQueryString(args);

      // Check cache
      if (use_cache && url_with_query in this.cache) {
        return this.cache[url_with_query];
      }

      // If query string is too long, upgrade GET method to POST
      if (method == 'GET' && (location.host + url_with_query).length > 1000) {
        method = 'POST';
      }

      const headers = new Headers();
      headers.append('Content-Type', 'application/json');

      const init_obj = {
        method: method,
        headers: headers,
        credentials: 'same-origin',
      };

      // Don't add data on GET requests
      if (method !== 'GET') {
        init_obj.body = JSON.stringify(data);
      }

      const request = fetch(
        method === 'GET' ? url_with_query : url_without_query,
        init_obj
      )
        .then(function (response) {
          // this will never happen
          // JSON was returned from WebSocket
          if (typeof response.json == 'undefined') {
            // TODO: ? Unfortunately this has no HTTP status like the result of fetch
            return response;
          }

          // Request object was returned from fetch
          // Read json stream
          var json = response.json();

          if (response.status >= 200 && response.status < 300) {
            return json;
          }

          // If bad request (code 300 or higher), reject promise
          return json.then(Promise.reject.bind(Promise));
        })
        .catch(function (server_error) {
          // Construct real Error object
          const err = new Error(server_error.message.message);
          err.metadata = server_error.message || {};
          err.metadata.status_code = server_error.status_code;
          err.metadata.title = server_error.title;

          // Log error in collapsed group
          console.groupCollapsed(
            method,
            server_error.status_code,
            server_error.title
          );
          // console.error(url_without_query);
          if ('message' in server_error) {
            console.error(method == 'GET' ? url_with_query : url_without_query);
            console.error(server_error.message.message);
            console.error(server_error.message.context);
          }
          console.groupEnd();

          throw err;
        });

      // Check cache for GET/POST
      if (use_cache && (method == 'GET' || method == 'POST')) {
        this.cache[url_with_query] = request;
      }

      return request;
    }

    get(meta_id, args) {
      return this._resource('GET', meta_id, args);
    }

    post(meta_id, data) {
      return this._resource('POST', meta_id, {}, data);
    }

    patch(meta_id, data) {
      return this._resource('PATCH', meta_id, {}, data);
    }

    delete(meta_id, args) {
      return this._resource('DELETE', meta_id, args);
    }
  }

  AQ.uuid = function () {
    var d = new Date().getTime();
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(
      /[xy]/g,
      function (c) {
        var r = (d + Math.random() * 16) % 16 | 0;
        d = Math.floor(d / 16);
        return (c == 'x' ? r : (r & 0x7) | 0x8).toString(16);
      }
    );
  };
  /*--------------------------------- * Database * ---------------------------------*/
  AQ.Database = function (url, settings) {
    this.settings = settings;

    if (typeof this.settings.evented === 'string') {
      console.warn(
        'AQ.Database: `evented` setting has been deprecated. Use `events=true|false` instead'
      );
      delete this.settings.evented;
    }

    this.settings.events = Object.hasOwn(this.settings, 'events')
		? this.settings.events
		: false;
    this.endpoint = new Endpoint(url, this, this.settings.events);
    this.tracked = {relation: {}, row: {}, field: {}};

    if (this.settings.events) {
      this.schema('event')
        .function('session_create')
        .then(
          function (result) {
            const sessionId = result.get('session_create');
            if (sessionId) {
              this.endpoint.connectSession(sessionId);
              persistSessionId(sessionId);
            } else {
              console.log('got a null sessionId', sessionId);
            }
          }.bind(this)
        );
    }
  };
  AQ.Database.prototype.constructor = AQ.Database;
  AQ.Database.prototype.schema = function (name) {
    return new AQ.Schema(this, name);
  };
  AQ.Database.prototype.getTracked = function (id) {
    let idType;
    if (id.startsWith('/relation/')) {
      idType = 'relation';
    } else if (id.startsWith('/row/')) {
      idType = 'row';
    } else if (id.startsWith('/field/')) {
      idType = 'field';
    }
    const tracked = this.tracked[idType][id];
    if (!tracked) {
      return [];
    }
    return tracked;
  };
  AQ.Database.prototype.track = function (id, obj) {
    // TODO: db.track should only be called when events are set up on this query
    let idType;
    if (id.startsWith('/relation/')) {
      idType = 'relation';
    } else if (id.startsWith('/row/')) {
      idType = 'row';
    } else if (id.startsWith('/field/')) {
      idType = 'field';
    }

    // columns are supposed to have events, but what does that mean?
    // functions do not have events
    // schema do not have events

    switch (idType) {
      case 'relation':
        this.tracked.relation[id] = this.tracked.relation[id] || [];
        this.tracked.relation[id].push(obj);
        break;
      case 'row':
        this.tracked.row[id] = obj;
        break;
      case 'field':
        this.tracked.field[id] = obj;
        break;
    }
  };

  /*--------------------------------- * Schema * ---------------------------------*/
  AQ.Schema = function (database, name) {
    this.database = database;
    this.name = name;
    this.id = {name: this.name};
  };
  AQ.Schema.prototype.constructor = AQ.Schema;
  AQ.Schema.prototype.relation = function (name) {
    return new AQ.Relation(this, name);
  };
  AQ.Schema.prototype.table = function (name) {
    return new AQ.Table(this, name);
  };
  AQ.Schema.prototype.view = function (name) {
    return new AQ.View(this, name);
  };
  AQ.Schema.prototype.function = function (identifier, args, options) {
    // Function identifier (name and parameter list)
    if (typeof identifier == 'object') {
      var name = identifier.name;
      var parameter_type_list = identifier.parameters;
    }
    // Selecting a function without specifying the parameters
    else {
      var name = identifier;
    }

    options = options || {};

    // Arguments
    options.args = {};

    // `args = undefined` will pass no arguments into the server-side function
    if (typeof args != 'undefined') {
      // some_function?args={ kwargs: {} } -- Key/value object
      if (!(args instanceof Array) && args instanceof Object) {
        options.args.kwargs = args;
      }
      // some_function?args={ vals: [] } -- Array
      else {
        if (!(args instanceof Array)) {
          // Regular value is placed into array
          args = [args];
        }
        options.args.vals = args;
      }
    }

    var fn = new AQ.Function(this, name, parameter_type_list);

    return this.database.endpoint
      .get(fn, options)
      .then(
        function (response) {
          if (!response) {
            throw 'Empty response';
          }
          /* sometimes results can be empty and that is ok.
                else if (!response.result.length) {
                    throw 'Result set empty';
                }
				*/
          if (response.result.length === 0) {
              return null;
          }
          if (response.result.length != 1) {
            return new AQ.FunctionResultSet(fn, response);
          }
          return new AQ.FunctionResult(fn, response);
        }.bind(this)
      )
      .catch(function (err) {
        throw err;
      });
  };

  /*--------------------------------- * Relation * ---------------------------------*/
  function relationId(id) {
    return {
      url() {
        return '/relation/' + id.schema_id.name + '/' + id.name;
      },
    };
  }
  AQ.Relation = function (schema, name) {
    this.schema = schema;
    this.name = name;
    this.id = {schema_id: this.schema.id, name: this.name};
  };
  AQ.Relation.prototype.constructor = AQ.Relation;
  AQ.Relation.prototype.to_url = function (id_only) {
    return id_only
      ? '/relation/' + this.schema.name + '/' + this.name
      : this.schema.database.endpoint.url +
          '/relation/' +
          this.schema.name +
          '/' +
          this.name;
  };
  AQ.Relation.prototype.column = function (name) {
    return new AQ.Column(this, name);
  };
  AQ.Relation.prototype.rows = function (options) {
    return this.schema.database.endpoint
      .get(this, options)
      .then(
        function (rows) {
          if (rows == null) {
            throw 'Empty response';
          } /*
                else if (rows.result.length < 1) {
                    throw 'No rows returned';
                }*/
          const rowset = new AQ.Rowset(this, rows, options);
          this.schema.database.track(this.to_url(true), rowset);
          return rowset;
        }.bind(this)
      )
      .catch(function (err) {
        throw 'Rows request failed: ' + err;
      });
  };
  AQ.Relation.prototype.row = function () {
    // Multiple different ways to call 'row' function

    // 1. Calling with Options object
    if (typeof arguments[0] == 'object') {
      var obj = arguments[0];
      var args = arguments[1] || {};

      // AQ.Relation.row({ where: { column_name: 'column_name', op: '=', value: 'value' } })
      // Maybe it should be this one: AQ.Relation.row({ where: { column_name: value } })
      if (typeof obj.where != 'undefined') {
        args.where = obj.where;
      }
      // AQ.Relation.row({ column_name: 'column_name', op: '=', value: 'value' })
      // Maybe it should be this one: AQ.Relation.row({ column_name: value })
      else {
        args.where = obj;
      }
    }
    // 2. Calling with column_name and value
    else if (typeof arguments[0] == 'string') {
      // AQ.Relation.row(column_name, value [, options_obj])
      var name = arguments[0];
      var value = arguments[1];
      var args = arguments[2] || {};

      args.where = {name: name, op: '=', value: value};
    }
    // 3. Calling AQ.Relation.row() without arguments
    else {
      var args = {};
    }

    return this.schema.database.endpoint
      .get(this, args)
      .then(
        function (row) {
          if (row == null) {
            throw 'Empty response';
          } else if (row.result.length == 0) {
            return null; // throw 'No row returned';
          } else if (row.result.length > 1) {
            throw 'Multiple rows returned';
          }
          const aqRow = new AQ.Row(this, row);
          this.schema.database.track(aqRow.to_url(true), aqRow);
          return aqRow;
        }.bind(this)
      )
      .catch(function (err) {
        throw 'Row request failed: ' + err;
      });
  };

  /*--------------------------------- * Table * ---------------------------------*/
  AQ.Table = function (schema, name) {
    this.schema = schema;
    this.name = name;
    this.id = {schema_id: this.schema.id, name: this.name};
  };
  AQ.Table.prototype = Object.create(AQ.Relation.prototype);
  AQ.Table.prototype.constructor = AQ.Table;
  AQ.Table.prototype.insert = function (data) {
    if (typeof data == 'undefined') {
      // table.insert({}) is equivalent to table.insert()
      // both will insert default values
      data = {};
    }

    // Return inserted row promise
    return this.schema.database.endpoint
      .patch(this, data)
      .then(
        function (inserted_row) {
          if (inserted_row == null) {
            throw 'Empty response';
          }
          if (typeof data.length != 'undefined' && data.length > 1) {
            return new AQ.Rowset(this, inserted_row, null);
          }
          return new AQ.Row(this, inserted_row);
        }.bind(this)
      )
      .catch(function (err) {
        throw 'Insert failed: ' + err;
      });
  };

  /*--------------------------------- * View * ---------------------------------*/
  AQ.View = function (schema, name) {
    this.schema = schema;
    this.name = name;
    this.id = {schema_id: this.schema.id, name: this.name};
  };
  AQ.View.prototype = Object.create(AQ.Relation.prototype);
  AQ.View.prototype.constructor = AQ.View;

  /*--------------------------------- * Rowset * ---------------------------------*/
  class Callbacks {
    constructor() {
      this.map = new Map();
    }
    call(cbType, payload) {
      const callbacks = this.map.get(cbType) || [];
      for (const callback of callbacks) {
        callback(payload);
      }
    }
    add(cbType, cb) {
      this.map.set(
        cbType,
        this.map.has(cbType) ? this.map.get(cbType).concat(cb) : [cb]
      );
    }
    remove(cbType, cb) {
      const callbacks = this.map.get(cbType);
      if (callbacks) {
        this.map.set(
          cbType,
          callbacks.filter((callback) => callback !== cb)
        );
      }
    }
  }

  AQ.Rowset = function (relation, response, server_arguments) {
    this.relation = relation;
    this.schema = relation.schema;
    this.columns = response.columns || null;
    this.pk_column_name = response.pk || null;
    this.rows = response.result;
    this.length = response.result.length;
    this.server_arguments = server_arguments || {};
    this.callbacks = new Callbacks();
  };
  AQ.Rowset.prototype.constructor = AQ.Rowset;
  AQ.Rowset.prototype.map = function (fn) {
    return this.rows
      .map(
        function (row) {
          return new AQ.Row(this.relation, {
            columns: this.columns,
            pk: this.pk_column_name,
            result: [row],
          });
        }.bind(this)
      )
      .map(fn);
  };
  AQ.Rowset.prototype.forEach = function (fn) {
    const newRow = (row) => {
      return new AQ.Row(this.relation, {
        columns: this.columns,
        pk: this.pk_column_name,
        result: [row],
      });
    };
    this.onInsert(fn);
    this.rows.map(newRow).forEach(fn);
    return this;
  };
  AQ.Rowset.prototype.reload = function () {
    return this.relation.rows(this.server_arguments);
  };
  AQ.Rowset.prototype._triggerEvent = function (eventType, payload, newRowId) {
    const relId = this.relation.id;
    const pkColumn = this.pk_column_name;
    const rowIdStr = rowId(
      newRowId.pk_column_id.relation_id,
      newRowId.pk_value
    ).url();
    // TODO: need a rewrite on datum to fix this
    // imitate api response to create row
    const newRow = (row, pk) => {
      return new AQ.Row(this.relation, {
        columns: this.columns,
        pk: pk || this.pk_column_name,
        result: [row],
      });
    };
    switch (eventType) {
      case 'insert': {
        const completeRow = {row: payload};
        this.rows.push(completeRow);
        payload = newRow(completeRow);
        break;
      }
      case 'update': {
        // TODO: I think payload is only the update fields, may need to reconstruct real row
        let index = this.rows.findIndex(
          ({row}) => rowId(relId, row[pkColumn]).url() === rowIdStr
        );
        if (index < 0) {
          console.error(
            'AQ.Rowset: trying to trigger update on nonexistant row'
          );
          break;
        }
        const completeRow = {row: {...this.rows[index].row, ...payload}};
        this.rows[index] = completeRow;
        payload = newRow(completeRow, pkColumn);
        break;
      }
      case 'delete': {
        // TODO: I think payload is only the row_id, may need to reconstruct real row
        let index = this.rows.findIndex(
          (row) => rowId(relId, row[pkColumn]).url() === rowIdStr
        );
        if (!index) {
          console.error(
            'AQ.Rowset: trying to trigger delete on nonexistant row'
          );
          break;
        }
        this.rows.splice(index, 1);
        payload = rowIdStr;
        break;
      }
    }
    this.callbacks.call(eventType, payload);
  };
  AQ.Rowset.prototype.onInsert = function (fn) {
    // TODO: maybe get rid of string
    this.callbacks.add('insert', fn);
  };
  AQ.Rowset.prototype.onUpdate = function (fn) {
    // TODO: can you update a rowset?
    this.callbacks.add('update', fn);
  };
  AQ.Rowset.prototype.onDelete = function (fn) {
    this.callbacks.add('delete', fn);
  };

  /**
   * Call AQ.Rowset.where with (where_obj) or use shorthand notation (field, value) - filter results programmatically
   *
   * @param {Object} where_obj
   * @param {[Boolean]} return_first
   * @param {[Boolean]} async
   *
   * OR
